-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\"><o:p> </o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"AR-EG\" style=\"font-size:10.0pt;line-height:115%;font-family:\" arial\",\"sans-serif\";=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\"><o:p> </o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"AR-EG\" style=\"font-size:10.0pt;line-height:115%;font-family:\" arial\",\"sans-serif\";=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\"><o:p> </o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" dir=\"RTL\" style=\"text-align:center\"><b><span dir=\"LTR\" style=\"font-size:20.0pt;line-height:115%;mso-bidi-language:AR-EG\">T.G.Real\r\nEstate Value Proposition<o:p></o:p></span></b></p>\r\n\r\n<p class=\"Pa41\" align=\"center\" style=\"margin-top:6.0pt;margin-right:18.0pt;\r\nmargin-bottom:3.0pt;margin-left:18.0pt;text-align:center\"><span class=\"A12\"><span style=\"font-size:13.0pt\">What makes us valid? </span></span><span style=\"font-size: 13pt;\"><o:p></o:p></span></p>\r\n\r\n<p class=\"Pa2\" style=\"margin-top:3.0pt;margin-right:0cm;margin-bottom:3.0pt;\r\nmargin-left:0cm\"><span class=\"A12\"><span style=\"font-size:13.0pt;font-family:\r\n\" adobe=\"\" garamond=\"\" pro\",\"serif\"\"=\"\">  The knowledge,\r\nattitudes, skills, and beliefs we already have.</span></span><span style=\"font-size: 11.5pt;\"><o:p></o:p></span></p>\r\n\r\n<p class=\"Pa2\" style=\"margin-top:3.0pt;margin-right:0cm;margin-bottom:3.0pt;\r\nmargin-left:0cm\"><span style=\"font-size: 11.5pt;\">We offer personal and professional service for all your real\r\nestate needs, including getting your home sold or helping you find the home of\r\nyour dreams in less time and with less hassle, which helps you get what you\r\ndesire with ease. <o:p></o:p></span></p>\r\n\r\n<p class=\"Pa42\" style=\"margin-top:3.0pt;margin-right:0cm;margin-bottom:6.0pt;\r\nmargin-left:0cm\"><b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\">Technology Focus: </span></b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 11.5pt;\">I’m\r\nan efficient, effective agent who won’t waste your time. Property searches on\r\nmy website are simplified. You’ll get immediate review of all properties that\r\nfit your criteria and be able to get an appointment to visit properties with\r\njust two clicks. Electronic documents and e-signing assure your offer won’t\r\narrive late. It’s simple and quick, with your needs in mind.</span><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm 6pt; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\">Buyer Focus: </span></b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 11.5pt; font-family: \" adobe=\"\" garamond=\"\" pro\",=\"\" serif;\"=\"\">I am your real estate consultant and advocate and offer you access\r\nto my technology system, which allows you to have more information quicker so\r\nyou can act accordingly to get into the home of your dreams. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm 6pt; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\">Buyer Focus: </span></b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 11.5pt; font-family: \" adobe=\"\" garamond=\"\" pro\",=\"\" serif;\"=\"\">I specialize in finding homes in great neighborhoods with great\r\nschools and easy access to shopping, which helps you find the home you want\r\nwith confidence. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm 6pt; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\">Luxury Focus: </span></b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 11.5pt; font-family: \" adobe=\"\" garamond=\"\" pro\",=\"\" serif;\"=\"\">I specialize in luxury properties, including view, lakeside, and\r\nsecond homes. I provide personal attention, market expertise, and counseling on\r\nall aspects of your transaction and make the process effortless and\r\nuncomplicated to you our valued customer. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 3pt 0cm 6pt; line-height: 12.05pt; direction: ltr; unicode-bidi: embed;\"><b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\">Green Focus: </span></b><span style=\"font-size: 11.5pt; font-family: \" gill=\"\" sans=\"\" mt\",=\"\" sans-serif;\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 11.5pt; font-family: \" adobe=\"\" garamond=\"\" pro\",=\"\" serif;\"=\"\">I specialize in green real estate including\r\ngreen building, sustainable construction, and sustainable design. This allows\r\nme to market properties with green features to buyers who want to save money\r\nand live comfortably, through energy efficiency, renewable energy, and\r\nenvironmentally sensitive choices. My company wrote the book on greening your\r\nhome, which allows me to provide buyers with information on topics such as\r\ngreen financing, energy-efficient appliances, radiant floor heating, mold\r\nmitigation, and much more.</span><span style=\"font-size:12.0pt;font-family:\r\n\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\"\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\"><o:p> </o:p></span></p>\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"627\" style=\"width: 470.45pt; border: none;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes;\r\n  height:518.3pt\">\r\n  <td width=\"627\" valign=\"top\" style=\"width:470.45pt;border:solid black 1.0pt;\r\n  mso-border-themecolor:text1;mso-border-alt:solid black .5pt;mso-border-themecolor:\r\n  text1;padding:0cm 5.4pt 0cm 5.4pt;height:518.3pt\">\r\n  <p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:12.0pt;text-align:center;\r\n  line-height:14.65pt;direction:ltr;unicode-bidi:embed\"><v:shapetype i