INSERT INTO `tbl_about` (`id_config`, `title`, `title_ar`, `about`, `about_ar`, `vid_link`) VALUES
(1, 'Our Mission Is To Help You Find Your Dream House', 'مهمتنا هي مساعدتك في العثور على منزل أحلامك', '<p><span source=\"\" sans=\"\" pro\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:arial;=\"\" color:#3a3a3a\"=\"\">Our company has served the community for over 30 years and is one of the most successful “private company’s “today. Our tradition of success comes from our commitment to fostering close relations with partners based on mutual respect fo- the idea of quality of work at competitive prices delivered with high standards of business practices. As a “private company” we are dedicated to the provision of high-quality services and are committed to customer satisfaction. We believe that our proven track record shows that we know what is essential to develop successful business relation. And in keeping with this tradition we work hard to keep our standards high and strive for quality in all areas of our business. T.G. General Services is a full-service company for the Construction, Decoration, Maintenance Services and Real Estate for commercial and residential properties. At T.G. General Services we place the highest value on human well-being.</span></p><p><br></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; direction: ltr; unicode-bidi: embed;\"><span source=\"\" sans=\"\" pro\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:arial;=\"\" color:#3a3a3a\"=\"\">Our company has served the community for over 30 years and is one of the most successful “private company’s “today. Our tradition of success comes from our commitment to fostering close relations with partners based on mutual respect fo- the idea of quality of work at competitive prices delivered with high standards of