</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; direction: ltr; unicode-bidi: embed;\"><span cambria\",\"serif\";mso-ascii-theme-font:=\"\" major-latin;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-hansi-theme-font:=\"\" major-latin;mso-bidi-font-family:aharoni\"=\"\" style=\"font-size: 14pt;\">      b. assist with post closing issues<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; direction: ltr; unicode-bidi: embed;\"><span cambria\",\"serif\";mso-ascii-theme-font:=\"\" major-latin;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-hansi-theme-font:=\"\" major-latin;mso-bidi-font-family:arial\"=\"\" style=\"font-size: 14pt;\"> </span></p></td></tr></tbody></table><p><span source=\"\" sans=\"\" pro\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:arial;=\"\" color:#3a3a3a\"=\"\"><w:wrap anchorx=\"page\"></w:wrap></span><span style=\"font-size: 14pt; font-family: Arial, sans-serif;\"><o:p></o:p></span></p><div><span source=\"\" sans=\"\" pro\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:arial;=\"\" color:#3a3a3a\"=\"\"><br></span></div><p></p>', '<p>لقد خدمت شركتنا المجتمع لأكثر من 30 عامًا وهي واحدة من أنجح \"الشركات الخاصة\" اليوم. يأتي تقليدنا في النجاح من التزامنا بتعزيز العلاقات الوثيقة مع الشركاء على أساس الاحترام المتبادل لفكرة جودة العمل بأسعار تنافسية يتم تقديمها مع معايير عالية من الممارسات التجارية. بصفتنا \"شركة خاصة\" ، نحن ملتزمون بتقديم خدمات عالية الجودة وملتزمون بإرضاء العملاء. نعتقد أن سجلنا الحافل يُظهر أننا نعرف ما هو ضروري لتطوير علاقة عمل ناجحة. وتماشياً مع هذا التقليد ، نعمل بجد للحفاظ على معاييرنا عالية والسعي لتحقيق الجودة في جميع مجالات عملنا. ت. الخدمات العامة هي شركة خدمات متكاملة للبناء والديكور وخدمات الصيانة والعقارات للعقارات التجارية والسكنية. في T.G. الخدمات العامة نولي أعلى قيمة لرفاهية الإنسان<br></p>', 'irsT9nMNAyg');
INSERT INTO `tbl_about_service` (`service_id`, `service_title`, `service_title_ar`, `image`, `service_details`, `service_details_ar`) VALUES
(3, 'We provide full service at every step.', 'نحن نقدم خدمة كاملة في كل خطوة', 'about-20210322dbf66645e5.jpg', '                                                       We provide full service at every step.<h3 xss=\"removed\"><u>The Problem</u></h3><p xss=\"removed\">There is a lack of information in the Egyptian Real Estate Market. Making an informed decision requires time consuming manual work and comparing between available options is a difficult task. This creates an unnecessary time burden and leads to incorrect Decision making when buying/selling properties.</p>', '                      <p>           نحن نقدم خدمة كاملة في كل خطوة</p><pre class=\"tw-data-text tw-text-large XcVN5d tw-ta\" data-placeholder=\"Translation\" id=\"tw-target-text\" dir=\"rtl\" xss=removed><span lang=\"ar\">المشكلة\r\nهناك نقص في المعلومات في سوق العقارات المصري. يتطلب اتخاذ قرار مستنير عملاً يدويًا يستغرق وقتًا طويلاً ، كما أن المقارنة بين الخيارات المتاحة مهمة صعبة. هذا يخلق عبئًا زمنيًا غير ضروري ويؤدي إلى اتخاذ قرارات غير صحيحة عند شراء / بيع العقارات.</span></pre><p>           </p>'),
(2, 'We provide full service at every step.', 'نحن نقدم خدمة كاملة في كل خطوة', 'about-202103225fd6d83bb5.jpg', '           <p>                      We provide full service at every step.</p><p><span xss=removed>A one-stop-shop that will provide you with the key to your new home by presenting all the necessary information and helps you make a decision through our reliable Brokers.</span><br></p>', '           <p>           نحن نقدم خدمة كاملة في كل خطوة</p><pre class=\"tw-data-text tw-text-large XcVN5d tw-ta\" data-placeholder=\"Translation\" id=\"tw-target-text\" dir=\"rtl\" xss=removed><span lang=\"ar\">متجر شامل يوفر لك مفتاح منزلك الجديد من خلال تقديم جميع المعلومات الضرورية ويساعدك على اتخاذ القرار عبر وسطاء موثوقين.</span></pre><p>           </p>');
