(31, 'Qasem Mohamed T.G. Real Estate', 'qasem-mohamed-tg-real-estate', 'male', '202103221616439536.jpg', '25166283', '01223255560', '01000007459', '01003335769', '01110106121', '25213259', 'Mohamed@egyptrealtor.com', 'galal@egyptrealtor.com', '', '', '', '', 'Egypt', '                                                                                        <p xss=removed><span source=\"\" sans=\"\" times=\"\" new=\"\" mso-bidi-font-family:arial;=\"\">Our company has served the community for over 30 years and is one of the most successful “private company’s “today. Our tradition of success comes from our commitment to fostering close relations with partners based on mutual respect fo- the idea of quality of work at competitive prices delivered with high standards of business practices. As a “private company” we are dedicated to the provision of high-quality services and are committed to customer satisfaction. We believe that our proven track record shows that we know what is essential to develop successful business relation. And in keeping with this tradition we work hard to keep our standards high and strive for quality in all areas of our business. T.G. General Services is a full-service company for the Construction, Decoration, Maintenance Services and Real Estate for commercial and residential properties. At T.G. General Services we place the highest value on human well-being.=</span></p>                                                                             ', '                                                                             لقد خدمت شركتنا المجتمع لأكثر من 30 عامًا وهي واحدة من أنجح \"الشركات الخاصة\" اليوم. يأتي تقليدنا في النجاح من التزامنا بتعزيز العلاقات الوثيقة مع الشركاء على أساس الاحترام المتبادل لفكرة جودة العمل بأسعار تنافسية يتم تقديمها مع معايير عالية من الممارسات التجارية. بصفتنا \"شركة خاصة\" ، نحن ملتزمون بتقديم خدمات عالية الجودة وملتزمون بإرضاء العملاء. نعتقد أن سجلنا الحافل يُظهر أننا نعرف ما هو ضروري لتطوير علاقة عمل ناجحة. وتماشياً مع هذا التقليد ، نعمل بجد للحفاظ على معاييرنا عالية والسعي لتحقيق الجودة في جميع مجالات عملنا. ت. الخدمات العامة هي شركة خدمات متكاملة للبناء والديكور وخدمات الصيانة والعقارات للعقارات التجارية والسكنية. في T.G. الخدمات العامة نولي أعلى قيمة لرفاهية الإنسان           ', 'active', 'yes', '2021-02-27 18:00:09', '2021-04-17 00:44:01', 1, 0.00, 0.00),
