(19, '2020-09-30', 'Title', 'title', '           <label xss=removed>Keywords And Descrioption (For Google Search) </label><span xss=removed></span><label xss=removed>Keywords And Descrioption (For Google Search) </label><span xss=removed></span><label xss=removed>Keywords And Descrioption (For Google Search)</label><span xss=removed></span>', 1, 'article-202011015d69dc892b.png', 'Keywords And Descrioption (For Google Search)', '2020-11-01 17:16:05', '2020-11-01 15:18:42'),
(20, '2021-01-19', 'عرف التقييم العقاري ؟', 'عرف-التقييم-العقاري', '<p><span dir=\"RTL\"></span><span lang=\"AR-EG\" dir=\"RTL\" xss=removed><span dir=\"RTL\"></span>: تعريف التقييم العقاري :<br>\r\nالتقييم العقاري هو تقدير قيمه العقارات او الاملاك في مختلف الاغراض مثل البيع او\r\nالرهن او الضمان العيني او القيمه التأمينيه .<br>\r\nالقيمه التي يصل اليها الخبير تعرف بـأسم القيمه السوقيه .</span>           </p>', 1, 'article-20210119085b01e9e3.jpg', 'عرف التقييم العقاري ؟', '2021-01-19 16:31:01', NULL),
(21, '2021-01-19', 'عرف القيمة السوقية و حدد الأسس و الأشتراكات التي يجب اتباعها للوصول الى القيمة السوقية ؟', 'عرف-القيمة-السوقية-و-حدد-الأسس-و-الأشتراكات-التي-يجب-اتباعها-للوصول-الى-القيمة-السوقية', '<p class=\"MsoNormal\" align=\"right\" xss=removed><span lang=\"AR-EG\" dir=\"RTL\" xss=removed>هى القيمة\r\n( الثمن ) الاكثر احتمالا الذى يغله( العائد) العقار فى سوق تنافس مفتوح و بشروط\r\nبيع عادل للبائع و المشترى حيث يتصرف كل منهم بمهارة و علم و بافتراض ان السعر غير\r\nمتأثر باي محفزات تمويل غير عادية و محفزات التمويل الغير عادية هي التقسيط –\r\nتأجيل السداد لفترة <o></o></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"right\" xss=removed><span lang=\"AR-EG\" dir=\"RTL\" xss=removed>يفترض فى\r\nهذا التعريف ان البيع يتم فى تاريخ محدد و ان نقل الملكية من البائع للمشترى يتم\r\nتحت الشروط التاليه :<o></o></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" xss=removed><span lang=\"AR-EG\" xss=removed>1ـالبائع و المشترى\r\nمتحمسان لاتمام الصفقة <o></o></span></p>\r\n\r\n<span lang=\"AR-EG\" dir=\"RTL\" xss=removed>2ـكل من البائع و المشترى لديه علم جيد بحاله\r\nالسوق والاسعار بنفسه او بواسطه مستشار<br>\r\nوكل من الطرفين يتصرف وفق صالحه الخاص</span><span lang=\"AR-EG\" dir=\"RTL\" xss=removed> .<br>\r\n<br>\r\n</span><span lang=\"AR-EG\" dir=\"RTL\" xss=removed>3ــ تم عرض العقار لفتره زمنيه مناسبه بالسوق\r\nالمفتوح.<br>\r\n<br>\r\n4ــ الدفع يتم بعمله البلد نقدا او ما يعادلها من وسائل تمويل ماليه .<br>\r\n<br>\r\n5ـ الثمن يمثل الحاله العاديه للعقار غير متأثر بتمويل خاص او تنازلات البيع\r\nممنوحه من اي من اطراف البيع .<br>\r\n<br>\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;<br>\r\n&lt;!--[endif]--&gt;</span>           ', 1, 'article-202101194c633dc3b6.JPG', 'عرف القيمة السوقية و حدد الأسس و الأشتراكات التي يجب اتباعها للوصول الى القيمة السوقية ؟', '2021-01-19 16:32:57', NULL),
(22, '2021-01-19', 'اذكر العوامل المؤثره علي قيمه العقار', 'اذكر-العوامل-المؤثره-علي-قيمه-العقار', '<span dir=\"RTL\"></span><span lang=\"AR-EG\" dir=\"RTL\" xss=removed><span dir=\"RTL\"></span>. العوامل المؤثره علي قيمه العقار\r\nاو الارض :<br>\r\n1ــ الموقع ( داخل المدن اعلي قيمه من خارجها- الشوارع الرئيسيه اعلي قيمه من\r\nالشوارع الجانبيه)<br>\r\n2ــ حصص الملكيه بين الشركاء (يفضل اقل عدد من الشركاء)<br>\r\n<br>\r\n3ــ سند الملكيه (العقد المسجل لدي الشهر العقاري اقوي من العقد الابتدائي او عقد\r\nصحه ونفاذ غير مشهر)<br>\r\n<br>\r\n4ــ الموقع (وقوع العقار علي عدد 2 ناصيه <br>\r\n<br>\r\n5ــ المساحه <br>\r\n<br>\r\n6ــ عرض الشارع (يزداد السعر مع اتساع الشارع)<br>\r\n<br>\r\n7ــ المرافق العامه والخدمات الخاصه بالمنطقه<br>\r\n<br>\r\n8ــ الشكل الهندسي للارض القريب من المربع افضل من المستطيل (بشكل عام)<br>\r\n<br>\r\n9ـ الاشتراكات الخاصه (زياده عدد الادوار او زياده المساحات الخضراء- وجود اماكن\r\nانتظار للسيارات )<br>\r\n<br>\r\n10ــ عدم وجود فراغات اضافيه.<br>\r\n<br>\r\n11ــ الحاله البنائيه للعقار <br>\r\n<br>\r\n12ـ وجود مستـأجر في العقار او العقار خالي .<br>\r\n13ــ المستوي الاجتماعي للسكان.<br>\r\n<br>\r\n14ـ مستوي البناء والتشطيب .<br>\r\n<br>\r\n15ــ طبيعه الانشاء (حوائط –هيكل خرساني – قواعد – خوازيق .... الخ)<br>\r\n<br>\r\n16ـ وجود تراخيص البناء.<br>\r\n<br>\r\n17ـ وجود حقوق ماديه او عينيه علي العقار او الارض .<br>\r\n<br>\r\n18ـ الحاله الاقتصاديه العامه(العرض والطلب )+ وقت البيع .<br>\r\n<br>\r\n19ـ القيود الامنيه في المنطقه قد تقلل من قيمه العقار .<br>\r\n<br>\r\n20ـ قيود الارتفاعات (مثل قريب من مطار).</span>           ', 1, NULL, ' العوامل المؤثره علي قيمه العقار', '2021-01-19 17:42:05', NULL);
