(32, 'Hazem Hassen Retag', 'hazem-hassen-retag', 'male', '202103281616959165.jpg', '1222222', '011187564478', '011187564478', '', '', '', 'info@e-ramo.net', 'info@e-ramo.net', 'https://www.facebook.com/eramosolutions/', '', '', '', 'new cairo', '                                                                                                                                    <div itemprop=\"definition\" class=\"-cms-content beginner-glossary-item__body\" xss=removed><div itemprop=\"description\" xss=removed><p xss=removed>A broker carries out clients’ <a href=\"https://alpari.com/en/beginner/glossary/order/\">orders</a> and fulfils the function of a middleman between the sellers and buyers of <a href=\"https://alpari.com/en/beginner/glossary/securities/\">securities</a>. In most cases, the client pays the broker for their services in the form of <a href=\"https://alpari.com/en/beginner/glossary/commission/\">commission</a>. There is also such a thing as a <a href=\"https://alpari.com/en/beginner/glossary/pit-or-floor/\">Floor/Pit</a> Broker.</p><div><br></div></div></div><div class=\"-share\" xss=removed></div>                                            ', '                                                                                                                                    <div itemprop=\"definition\" class=\"-cms-content beginner-glossary-item__body\" xss=removed><div itemprop=\"description\" xss=removed>الوسيط هو من ينفذ أوامر العملاء ويعمل كوسيط بين البائعين والمشترين ل<a href=\"https://alpari.com/ar/beginner/glossary/securities/\">لأوراق المالية.</a> في معظم الحالات، يقوم العملاء <a href=\"https://alpari.com/ar/beginner/glossary/order/\">بالدفع</a> للوسيط مقابل خدماته في شكل <a href=\"https://alpari.com/ar/beginner/glossary/commission/\">عمولة</a>. وهناك أيضا ما يعرف بوسطاء السعر الأدنى.</div></div><div class=\"-share\" xss=removed></div>           ', 'active', 'yes', '2021-03-10 11:00:35', '2021-03-28 19:19:25', 365, '2021-03-28', '2022-03-31', '1648684800', 50, 100, 1),
(34, 'Ahmed El Sayed Reechomes', 'ahmed-el-sayed-reechomes', 'male', '202104161618605020.jpg', '+15039279363', '01288886664', '01288886664', '+15039279363', '+15039279363', '', 'ahmedelsayed@cbbain.com', 'ahmedelsayed@cbbain.com', '', '', '', 'https://www.linkedin.com/in/ahmed-el-sayed-ba25455', 'Maadi', '                                 <p>                                                                                                                                    </p><div class=\"Spacer-c11n-8-31-0__sc-17suqs2-0 gfAYxH\" xss=removed><section id=\"activeListings\"><div display=\"flex\" class=\"Flex-c11n-8-31-0__n94bjd-0 kaQiaX\" xss=removed><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 bAIjQu\" xss=removed>Listings & sales (3)</h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><br></h2><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 eepwcO\" xss=removed>About me</h2><h3 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 UmHTc\" xss=removed>Architect (23 years experience)</h3><dl display=\"flex\" class=\"Flex-c11n-8-31-0__n94bjd-0 sc-AxhCb dXLBGn\" xss=removed><dt class=\"Text-c11n-8-31-0__aiai24-0 dwODIE\" xss=removed>Specialties</dt><dd class=\"Text-c11n-8-31-0__aiai24-0 exSAxi\" xss=removed>Buyer\'s agent</dd><dd class=\"Text-c11n-8-31-0__aiai24-0 exSAxi\" xss=removed>Listing agent</dd><dd class=\"Text-c11n-8-31-0__aiai24-0 exSAxi\" xss=removed>Relocation</dd><dd class=\"Text-c11n-8-31-0__aiai24-0 exSAxi\" xss=removed>FSBO,Luxury properties,</dd></dl><div class=\"sc-AxhUy fxWvvr\" xss=removed><div class=\"sc-AxiKw iqNOhU\"><p xss=removed><a href=\"https://ahmedelsayed.coldwellbankerbain.com/\" target=\"_self\">https://ahmedelsayed.coldwellbankerbain.com</a> ahmedelsayed.cbbain.com</p><p xss=removed>I am happy to provide My clients the best possible real estate buying and selling experience through our market knowledge.<br>I bring unique skills as a former owner of my own successful independent real estate practice since 1998, I supervised 27 agents and two offices. Also I was a practicing architect, and i am an international real estate agent with connections in multiple countries.I have personally represented over 852 buyers and sellers combining in over $240 millon in closed volume. </p><p xss=removed>Throughout my career, I found it rewarding to be generous with my time, when someone needs real estate guidance I am happy to provide that to the best of my ability even if it means the guidance is given for free. This long-term focus on building relationships and creating win-win solutions is something that has helped me to be successful over the long term. When I broker a transaction, I enjoy helping parties who naturally have competing interests.<br></p></div></div><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed><span xss=removed>come together to create an agreement that works for everyone. The best outcome is when all parties are successful.</span>   Active listings</h2></div><span class=\"Text-c11n-8-31-0__aiai24-0 hWBaNP\" xss=removed>Active listings data currently unavailable.</span></section></div><div class=\"Spacer-c11n-8-31-0__sc-17suqs2-0 gfAYxH\" xss=removed><section id=\"pastSales\"><div display=\"flex\" class=\"Flex-c11n-8-31-0__n94bjd-0 kaQiaX\" xss=removed><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 dwHUyS\" xss=removed>Past sales (3)</h2><p xss=removed><br></p></div></section></div><h2 font-family=\"sansSerif\" class=\"Text-c11n-8-31-0__aiai24-0 StyledHeading-c11n-8-31-0__ktujwe-0 kpuBFt\" xss=removed>Service areas (3)</h2><p>https://www.zillow.com/profile/ahmedelsayed55</p><p>&lt;form class=\"Form-c11n-8-31-0__iqxs9k-0 sc-fzoydu iQZVbJ\" style=\"box-sizing: border-box; border-bottom: 1px solid rgb(209, 209, 213); border-top-color: rgb(209, 209, 213); border-right-color: rgb(209, 209, 213); border-left-color: rgb(209, 209, 213); margin-bottom: 16px; color: rgb(42, 42, 51); font-family: \"Open Sans\", Gotham, gotham, Tahoma, Geneva, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"&gt;<div display=\"flex\" class=\"Flex-c11n-8-31-0__n94bjd-0 jwRSUp\" xss=removed><div class=\"Flex-c11n-8-31-0__n94bjd-0 hpijSe\" xss=removed><div class=\"StyledFormField-c11n-8-31-0__sc-24oslp-0 bSPWzD\" xss=removed></div></div></div>&lt;/form&gt;</p><div 