(17, 4, '2020-10-31', 'Covid-19: PM set to announce month-long England lockdown ', NULL, 'covid-19-pm-set-to-announce-month-long-england-lockdown-covid-19-pm-set-to-announce-month-long-england-lockdown', '                                                                  <div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed><b class=\"css-14iz86j-BoldText e5tfeyi0\" xss=removed>Prime Minister Boris Johnson is set to announce a second national lockdown for England as the UK passed one million Covid-19 cases.</b></p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>Non-essential shops and hospitality will have to close for a month, sources told the BBC.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>But unlike the restrictions in the spring, schools and colleges are to be allowed to stay open.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>It comes as <a href=\"https://www.bbc.co.uk/news/uk-54756950\" class=\"css-yidnqd-InlineLink e1no5rhv0\">documents suggested the UK was on course for a much higher death toll</a> than during the first wave.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>The lockdown is also expected to include restrictions on travel and is due to come into force on Thursday, lasting until 2 December, BBC political correspondent Nick Eardley said.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>The prime minister is due to lead a news conference later, after holding a cabinet meeting to discuss the coronavirus response.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>He is set to be joined by England\'s chief medical officer Chris Whitty and the government\'s chief scientific adviser Sir Patrick Vallance for the briefing.</p></div></div><div data-component=\"unordered-list-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><div class=\"css-1pzprxn-BulletListContainer e5tfeyi3\" xss=removed><ul role=\"list\" xss=removed><li xss=removed><a href=\"https://www.bbc.co.uk/news/business-54751632\" class=\"css-yidnqd-InlineLink e1no5rhv0\">\'A new lockdown will be far worse for businesses\'</a></li><li xss=removed><a href=\"https://www.bbc.co.uk/news/health-54750775\" class=\"css-yidnqd-InlineLink e1no5rhv0\">Covid spreading faster than \'worst-case scenario\'</a></li><li xss=removed><a href=\"https://www.bbc.co.uk/news/uk-53954492\" class=\"css-yidnqd-InlineLink e1no5rhv0\">Winter virus plans revealed in leaked Sage report</a></li></ul></div></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>The UK recorded another 21,915 confirmed coronavirus cases on Saturday, bringing the total since the pandemic began to 1,011,660.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>Another 326 people were reported to have died within 28 days of a positive test.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>The UK is the ninth country to reach the milestone of a million cases - after the US, India, Brazil, Russia, France, Spain, Argentina and Colombia.</p></div></div><div data-component=\"text-block\" class=\"css-uf6wea-RichTextComponentWrapper e1xue1i82\" xss=removed><div class=\"css-83cqas-RichTextContainer e5tfeyi2\" xss=removed><p xss=removed>But the true number of infections is expected to be higher due to a lack of widespread testing at the start of the pandemic.</p></div></div>           ', NULL, 1, 'news-2020103150c57f7019.jpg', 'Covid-19: PM set to announce month-long England lockdown Covid-19: PM set to announce month-long England lockdown\r\n\r\n', NULL, NULL, '2020-10-31 19:51:10', '2020-12-20 19:12:24', NULL, 'activ'),
