(19, 1, '2021-02-10', 'مؤمن زكريا يتحول لـ \"مشجع\" ويطالب لاعبي الأهلى ببرونزية مونديال العالم', NULL, 'مؤمن-زكريا-يتحول-لـ-مشجع-ويطالب-لاعبي-الأهلى-ببرونزية-مونديال-العالم', '<p dir=\"RTL\" class=\"selectionShareable\" xss=removed>حرص النجم مؤمن زكريا، لاعب النادي الاهلى، على دعم فريقه في مباراته القادمة المقرر لها غداً في تمام الساعة الخامسة مساءً أمام نادي بالميراس البرازيلي، لتحديد المركز الثالث والرابع من بطولة كأس العالم للاندية التي تقام حالياً في قطر ويشارك فيها الأهلى للمرة السادسة.</p><p dir=\"RTL\" class=\"selectionShareable\" xss=removed>ونشر زكريا، صورة للاعبي النادي الاهلى عبر حسابه الشخصى بموقع انستجرام، لدعمهم في المباراة القادمة، مطالباً بالميدالية البرونزية للمركز الثالث أمام النادى البرازيلي</p>           ', NULL, 1, 'news-202102106dd9e9a390.jpg', 'مؤمن زكريا يتحول لـ \"مشجع\" ويطالب لاعبي الأهلى ببرونزية مونديال العالم\r\n', 'مؤمن زكريا يتحول لـ \"مشجع\" ويطالب لاعبي الأهلى ببرونزية مونديال العالم\r\n', NULL, '2021-02-10 20:18:58', NULL, NULL, 'activ'),
