(23, 1, '2021-03-08', 'xyz title', 'عنوان عربي', 'xyz-title', '                                 detail english', '                                 detail ar ar', 1, 'news-20210308ab0571807e.png', 'kkkk', 'dddd', NULL, '2021-03-08 08:16:16', '2021-04-14 12:54:53', NULL, 'activ'),
(24, 10, '2021-03-14', 'Market Value, Factors affecting the value of the property or land:', 'القيمة السوقية  العوامل المؤثره علي قيمه العقار او الارض :', 'market-value-factors-affecting-the-value-of-the-property-or-land', '                                                                             <p>Real estate Market Value<span xss=removed>Market value or OMV is the price at which an asset would trade in a competitive auction setting. Market value is often used interchangeably with open market value, fair value or fair market value, although these terms have distinct definitions in different standards, a</span></p><p>           </p>', '                                                                  <p>           <span xss=\"removed\">وعلى الرغم من أن </span><b xss=\"removed\">القيمة السوقية</b><span xss=\"removed\"> قد تستوفي هذه المعايير، فإن هذا ليس بالضرورة هو الحال دائمًا. وكثيرًا ما تستخدم </span><b xss=\"removed\">القيمة</b><span xss=\"removed\"> العادلة عند القيام بالعناية الواجبة في المعاملات المؤسسية، حيث قد يعني التآزر الخاص بين الطرفين أن السعر العادل بينهما هو أعلى من السعر الذي يمكن الحصول عليه في السوق الأوسع نطاقًا</span></p><h4 dir=\"rtl\" xss=removed><u>العوامل المؤثره علي قيمه العقار او الارض :</u></h4><p><span xss=\"removed\"></span>           </p><div dir=\"rtl\" xss=removed> <font xss=removed>1ــ الموقع ( داخل المدن اعلي قيمه من خارجها- الشوارع الرئيسيه اعلي قيمه من الشوارع الجانبيه) .<br>2ــ حصص الملكيه بين الشركاء (يفضل اقل عدد من الشركاء).<br> 3ــ سند الملكيه (العقد المسجل لدي الشهر العقاري اقوي من العقد الابتدائي او عقد صحه ونفاذ غير مشهر) .<br> 4ــ الموقع (وقوع العقار علي عدد 2 ناصيه.<br> 5ــ المساحه.<br> 6ــ عرض الشارع (يزداد السعر مع اتساع الشارع).<br> 7ــ المرافق العامه والخدمات الخاصه بالمنطقه.<br> 8ــ الشكل الهندسي للارض القريب من المربع افضل من المستطيل (بشكل عام) .<br> 9ـ الاشتراكات الخاصه (زياده عدد الادوار او زياده المساحات الخضراء- وجود اماكن انتظار للسيارات ).<br> 10ــ عدم وجود فراغات اضافيه.<br> 11ــ الحاله البنائيه للعقار.<br> 12ـ وجود مستـأجر في العقار او العقار خالي .<br>13ــ المستوي الاجتماعي للسكان.<br> 14ـ مستوي البناء والتشطيب .<br> 15ــ طبيعه الانشاء (حوائط –هيكل خرساني – قواعد – خوازيق .... الخ) 16ـ وجود تراخيص البناء.<br> 17ـ وجود حقوق ماديه او عينيه علي العقار او الارض .<br> 18ـ الحاله الاقتصاديه العامه(العرض والطلب )+ وقت البيع .<br> 19ـ القيود الامنيه في المنطقه قد تقلل من قيمه العقار .<br> 20ـ قيود الارتفاعات (مثل قريب من مطار.</font></div><div dir=\"rtl\" xss=removed><span xss=removed>مهندس /  محمد عبد الغتاح ( خبير تقيم عقارى)</span></div>', 1, 'news-20210314415e25a14a.jpeg', 'Market Value', 'Real estate Market Value,', NULL, '2021-03-14 19:57:23', '2021-04-14 13:32:15', 'hjEgSdZ1t14', 'activ'),
(25, 10, '2021-04-14', 'Market Value, Factors affecting the value of the property or land:', 'القيمة السوقية  العوامل المؤثره علي قيمه العقار او الارض :', 'market-value-factors-affecting-the-value-of-the-property-or-land-1', '                                            Real estate Market Value<span xss=\"removed\">Market value or OMV is the price at which an asset would trade in a competitive auction setting. Market value is often used interchangeably with open market value, fair value or fair market value, although these terms have distinct definitions in different standards, a</span>           ', '                                            <span xss=\"removed\">وعلى الرغم من أن </span><span xss=\"removed\" xss=removed>القيمة السوقية</span><span xss=\"removed\"> قد تستوفي هذه المعايير، فإن هذا ليس بالضرورة هو الحال دائمًا. وكثيرًا ما تستخدم </span><span xss=\"removed\" xss=removed>القيمة</span><span xss=\"removed\"> العادلة عند القيام بالعناية الواجبة في المعاملات المؤسسية، حيث قد يعني التآزر الخاص بين الطرفين أن السعر العادل بينهما هو أعلى من السعر الذي يمكن الحصول عليه في السوق الأوسع نطاقًا</span>           ', 1, 'news-20210414e24d23b5bc.jpg', 'Market Value', 'Real estate Market Value,', NULL, '2021-04-14 14:37:25', '2021-04-14 13:39:08', NULL, 'activ');
