(109, '2021-04-14', 10333, 'A building consisting of three detached villas on one land for sale in Katameya Dunes', 'A building consisting of three detached villas on one land for sale in Katameya Dunes', 'a-building-consisting-of-three-detached-villas-on-one-land-for-sale-in-katameya-dunes', 'A building consisting of three detached villas on one land for sale in Katameya Dunes', 'a-building-consisting-of-three-detached-villas-on-one-land-for-sale-in-katameya-dunes', 'a-building-consisting-of-three-detached-villas-on-one-land-for-sale-in-katameya-dunes', 'normal', 1, 2, 3, 4, 13, 25, 71, 'Katameya Dunes Villa 118', 'Katameya Dunes', 0, 0, 0, '', '', '', 0.00, 105000000.00, '0', 2, 3514.00, 1, 0, '', '', 0, 3077, '', '', '', 0, 0, 0, 0, 0, 0, '', 0, 11, 23, 23, 0, '', '', 0, '                                 <div>مبنى مكون من ثلاث فيلات متلاصقة على أرض واحدة مسطحها ٣,٥١٤م٢.</div><div>تم دراسة كل فيلا من حيث الاستقلالية و الخصوصية بفصل نصيبها من الأرض شاملا الحديقة الأمامية و إمكانية عمل حمام سباحة لكل فيلا على حدا، و بفصل مدخل كل فيلا و توجيه الفيلا لتطل على منظر ملاعب الجولف.</div><div>كل فيلا تتكون من دور بدروم + دور أرضى + دور أول.</div><div>الأرضى : صالة و سفرة + مطبخ كبير + حمام ضيوف.</div><div>الأول : نوم رئيسى + ٢ غرفة نوم (كل الغرف بها غرفة ملابس و حمام) + غرفة معيشة و تراس على الجولف.</div><div>البدروم : غرفة معيشة ضخمة + حمام + غرفة مخزن + غرفة غسيل ملابس + قسم خدم حريمى.</div><div>إجمالى مسطح المبانى لفيلا (A) :١,٠٦٤م٢</div><div>إجمالى مسطح المبانى لفيلا (B) : ١,٠٣٠م٢</div><div>إجمالى مسطح المبانى لفيلا (C) : ٩٤٨ م٢</div><div>بالإضافة إلى وحدة خدمات للرجال (٢غرفة + ٢ حمام + معيشة) بإجمالى ٢٠٦ م٢ لخدمة الثلاث فيلات.</div><div>المسطح الإجمالى للمبانى ٣,٢٤٧م٢<br><div>A building consisting of three detached villas on a single plot of 3,514 square meters.</div><div>Each villa was studied in terms of independence and privacy by separating its share of the land including the front garden and the possibility of creating a swimming pool for each villa separately, separating the entrance to each villa and directing the villa to the view of the golf courses.</div><div>Each villa consists of a basement + ground floor + first floor.</div><div>Ground: lounge and dining + large kitchen + guest bathroom.</div><div>The first: a master bedroom + 2 bedrooms (all rooms have a dressing room and a bathroom) + living room and terrace on the golf.</div><div>Basement: a huge living room + bathroom + storage room + laundry room + female servants section.</div><div>Total built-up area of ​​Villa (A): 1,064 m2</div><div>Total built-up area of ​​Villa (B): 1,030 m2</div><div>Total built-up area of ​​Villa (C): 948 m2</div><div>In addition to a service unit for men (2 rooms + 2 bathrooms + living rooms) with a total of 206 square meters to serve the three villas.</div><div>The total area of ​​the buildings is 3,247 m 2<br>Price: LE 105Million<br>Not finished<br></div></div>           ', '           ', 19, 209, NULL, NULL, NULL, '2021-03-03 09:32:44', '2021-04-14 19:23:40', 2, 25, 'sale', 1, NULL, 2, 25, 'activ'),
