(172, '2021-04-14', 10395, 'Villa with pool for rent semi furnished in Arabella compound', 'فيلا بحمام سباحة للايجار نصف مفروش بكمبوند ارابيلا', 'villa-with-pool-for-rent-semi-furnished-in-arabella-compound', 'Villa with pool for rent semi furnished in Arabella compound', 'فيلا-بحمام-سباحة-للايجار-نصف-مفروش-بكمبوند-ارابيلا', 'villa-with-pool-for-rent-semi-furnished-in-arabella-compound', 'normal', 1, 2, 31, 4, 13, 25, 60, 'Arabella compound', 'Arabella compound', 81, 0, 0, '', '', '', 80000.00, 0.00, '0', 2, 800.00, 1, 0, '', '', 0, 550, '', '1', '', 5, 0, 1, 6, 0, 0, '', 0, 14, 19, 25, 8, '', '', 7, '           <div>مساحة الأرض تقريبا ٨٠٠ متر - المباني ٥٨٠ متر .  تكييفات semi central . </div><div>٤ غرف في الدور الثاني . الماستر ارتفاع السقف ٥ متر  . في احد غرف الدور الثاني قسمنا الغرفة بسلم خشب داخلي وسقف خشب مسلح   واستفدنا من الارتفاع بغرفة إضافية . ال living room فيها بانوراما علي الرسيبشن بعرض الحائط وخرجنا بيها حوالي متر  ب view علي الرسبشن من خلال الحائط الزجاجي - وده واخد شكل نصف دايرة متعلقة كنصف الدائرة اللي في بانوراما المطبخ اللي في  الرسبشن . هناك غرفة كبيرة في البييسمنت وصالة كبيرة وحمام كامل بالإضافة لغرفة الغسيل وغرفة  للشغالة . </div><div>وبعدين الهاشمة في الرسبشن والرخام إيطالي  ، والهاشمة كاسية الفيلا كلها من الخارج . مفيش سخانات في الحمامات  . السخان مركزي غاز  في غرفة اللوندري في الدور الارضي والمواسير كلها في ضقط ديكوري مختفية  . ومفيش تكييفات علي الحوائط الخارجية ولا مواسير وصلات تكييفات  كل الوحدات في سطح الفيلا وكل مواسيرها تمر في الضقط الديكوري المختفي .</div>                                 ', '           <div>The land area is approximately 800 meters - the buildings are 580 meters. Semi central adaptations.</div><div>4 rooms on the second floor. Master ceiling height 5 meters. In one of the rooms on the second floor, we divided the room with an internal wood staircase and a reinforced wood ceiling, and we took advantage of the height with an additional room. The living room has a panorama on the reception room in the width of the wall, and we went out in it about a meter with a view of the reception through the glass wall - this took the form of a half-circle related to the half of the circle in the panorama of the kitchen in the reception. There is a large room in the basement, a large hall, a complete bathroom, in addition to a laundry room and a maid\'s room.</div><div>And then, Al-Hashemah is in Al-Rasbashn, the marble is Italian, and Al-Hashemah drapes the whole villa from the outside. There are no heaters in the bathrooms. The heater is central, gas in the laundry room on the ground floor, and the pipes are all in a hidden decorative pressure. There is no air conditioner on the external walls, no air conditioner pipes and connections, all the units in the roof of the villa and all its pipes pass through the hidden decorative pressure.</div>           ', 21, 274, NULL, NULL, NULL, '2021-03-21 15:12:04', '2021-04-14 19:14:36', 2, 26, 'rent', 3, NULL, 4, 22, 'activ'),
