(1, '<div class=\"grids mb30\" style=\"margin-bottom: 30px; color: rgb(119, 119, 119); font-family: Nunito, sans-serif; font-size: 16px;\"><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr><td align=\"center\" valign=\"top\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"height: 27px; width: 480px;\"><tbody><tr><td align=\"center\" valign=\"middle\" class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-style: normal; font-weight: bold; color: rgb(17, 121, 203); background-image: url(\" images=\"\" main=\"\" tite_bg.gif\");=\"\" height:=\"\" 27px;\"=\"\"><span id=\"ctl00_ContentPlaceHolder1_Label20\">Privacy Policy</span></td></tr></tbody></table><br></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">We at tgsrealty, Inc. and the family of companies at T.G.&nbsp; Group, our owner, (referred to as \"we,\" \"us,\" or \"our\") recognize the importance of protecting the privacy of certain information (\"Information\") collected about our customers and prospective customers (referred to as \"Customers,\" \"you\" or \"your\"). This privacy statement discloses what information we gather, how we use it, and how to correct or change it. It is our intention to give you an understanding about how we collect your Information and the use we make of it in the course of our business. To that end, we gather two types of information about Customers: data that Customers provide through optional, voluntary registration on our sites; and data we gather through aggregated tracking, mainly by tallying page views throughout our sites. Such information enables us to tailor our content to fit Customers’ needs better and to help our advertisers understand our audience. Providing such aggregated data is essential to keeping our service free to Customers.</font></font></p><p><font face=\"Verdana\"><font color=\"black\" size=\"2\"></font></font>&nbsp;</p></td></tr></tbody></table></h4><h4><span id=\"ctl00_ContentPlaceHolder1_lblginfo\">How do we collect Information?</span></h4><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr align=\"left\"><td class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-style: normal; font-weight: bold; color: rgb(17, 121, 203);\"></td></tr></tbody></table></h4><h5><font color=\"black\">Optional registration</font></h5><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr><td align=\"left\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">We collect information by specifically requesting it from you. Generally this occurs when you register at a site or request information or a service. Usually, our sites and service partners use your information to operate the sites and to deliver services. Our sites also use your information to inform you about other products or services available from us.</font></font></p></td></tr></tbody></table></h4><h5><font color=\"black\">Usage trackingUse of Internet Protocol (\"IP\") Addresses</font></h5><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr><td align=\"left\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">An IP address is a unique number that is automatically assigned to your computer whenever you’re surfing the Internet so that your computer can be identified by the main computers, known as \"Web servers,\" that \"serve up\" Web pages. We collect IP addresses for the purposes of system administration, to report aggregated information to our advertisers, and to audit the use of our site. When Customers request pages from our sites, our servers log the Customers’ IP addresses. We do not normally link IP addresses to anything personally identifiable, which means that a Customer’s session will be logged, but the Customer will remain anonymous to us. We can and will use IP addresses to identify a Customer when we feel it is necessary to enforce compliance with our site terms of use or terms of service or to protect our service, site, customers or others.</font></font></p><p>&nbsp;</p></td></tr></tbody></table></h4><h5><font color=\"black\">Use Of Cookies</font></h5><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr><td align=\"left\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">What are cookies? Cookies are small pieces of information that a Web site sends to yours computer for record-keeping purposes, which information is stored in a file on your computer. Cookies make Web surfing easier for you by saving your preferences so that we can use the saved information to facilitate your use of our Web site when you return to the site. Cookies do not tell us your individual identity unless you have chosen to provide it to us. We never save passwords or credit card information in cookies. The use of cookies is an industry standard, and as such, you’ll find that most major Web sites use them. By showing how and when Customers use a site, cookies help us see which areas are popular and which are not. Many improvements and updates to the site are based on such data as total number of visitors and pages viewed. This information is most easily tracked with cookies. We use the information from cookies to provide services better tailored to our Customers’ needs. Most cookies expire after a defined period of time, or you can delete your cookie file at any time. Most browsers are initially set up to accept cookies. You can reset your browser to refuse all cookies or indicate when a cookie is being sent. However, note that some parts of our services will not function properly or may be considerably slower if you refuse cookies. For example, without cookies, you will not be able to set personalized preferences, and/or may have difficulty completing marketing transactions. We have two primary uses for cookies. First, we use them to specify a Customer’s preferences. For example, Customers can specify keywords across several categories or markets so you don’t have to tell us repeatedly about certain features in the home you are seeking. Second, we use cookies to track Customers’ Web site usage trends and patterns. This helps us understand our Customers’ needs better and improve areas of services that our Customers find valuable. While both of these activities depend on the use of cookies, you have the option of disabling the cookies via your browser preferences. You may occasionally get cookies from our advertisers. We do not control these cookies. The use of advertising cookies sent by third-party servers is standard in the Internet industry.</font></font></p><p></p></td></tr></tbody></table></h4><h4><span id=\"ctl00_ContentPlaceHolder1_Label1\">With whom do we share your Information?</span></h4><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr align=\"left\"><td class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-style: normal; font-weight: bold; color: rgb(17, 121, 203);\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">As a general rule we will not disclose any specific personal information that you submit to us about you (\"Personal Information\") in a manner that connects you with the Personal Information. us.</font></font></p><p><font face=\"Verdana\"><font color=\"black\" size=\"2\"></font></font>&nbsp;</p></td></tr></tbody></table></h4><h4><span id=\"ctl00_ContentPlaceHolder1_Label2\">How can you control the usage of Information?</span></h4><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr align=\"left\"><td class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-style: normal; font-weight: bold; color: rgb(17, 121, 203);\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">In case you change your mind or some Personal Information changes (such as your zip code or e-mail address), we will try to provide a way to correct, update or remove the Personal Information that you give us. We also give you the opportunity to control the communications we direct to you. We offer Customers the opportunity to \"opt out\" of having Personal Information shared with parties outside of our company or our affiliated companies.</font></font></p></td></tr></tbody></table></h4><h4><span id=\"ctl00_ContentPlaceHolder1_Label4\">Is your Information secure from others using our site?</span></h4><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; width: 530.56px;\"><tbody><tr align=\"left\"><td class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-style: normal; font-weight: bold; color: rgb(17, 121, 203);\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">The importance of security of all information associated with our Customers is an important concern to us. We exercise care in providing secure transmission of your information from your computer to our servers. Unfortunately, no data transmission over the Internet can be guaranteed to be 100% secure. As a result, while we strive to protect your information, we can’t ensure or warrant the security of any information you transmit to us or from our online products or services, and you do so at your own risk. \"Perfect security\" does not exist on the Internet.</font></font></p></td></tr></tbody></table></h4><h4><span id=\"ctl00_ContentPlaceHolder1_Label5\">Your Acceptance of These Terms</span></h4><h4 style=\"margin-bottom: 25px; font-family: Nunito, sans-serif; color: rgb(72, 72, 72); font-size: 18px;\"><table style=\"color: rgb(255, 255, 255); font-family: Tahoma; font-size: 12px; width: 530.56px;\"><tbody><tr align=\"left\"><td class=\"titles\" style=\"font-family: tahoma; font-size: 14pt; font-weight: bold; color: rgb(17, 121, 203);\"></td></tr><tr><td width=\"745\" valign=\"top\"><p align=\"justify\"><font face=\"Verdana\"><font size=\"2\" color=\"#3a3a3a\">By using this site, you signify your agreement to our Privacy Policy. IF YOU DO NOT AGREE WITH THIS POLICY, PLEASE DO NOT USE THIS SITE. Your continued use of our site following the posting of changes to these terms will mean you accept those changes.</font></font></p></td></tr></tbody></table></h4></div>', '<div class=\"tw-ta-container hide-focus-ring tw-lfl\" id=\"tw-target-text-container\" tabindex=\"0\" style=\"overflow: hidden; position: relative; outline: 0px; color: rgb(32, 33, 36); font-family: arial, sans-serif; font-size: 0px; background-color: rgb(248, 249, 250);\"><pre class=\"tw-data-text tw-text-large XcVN5d tw-ta\" data-placeholder=\"Translation\" id=\"tw-target-text\" dir=\"rtl\" style=\"unicode-bidi: isolate; font-size: 24px; line-height: 32px; background-color: transparent; border: none; padding: 2px 0.14em 2px 0px; position: relative; margin-top: -2px; margin-bottom: -2px; resize: none; overflow: hidden; text-align: right; width: 270px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \" google=\"\" sans\",=\"\" arial,=\"\" sans-serif=\"\" !important;\"=\"\"><span lang=\"ar\">سياسة الخصوصية\r\n\r\nنحن في tgsrealty، Inc. وعائلة الشركات في شركة T.G. ، مالكنا (يشار إليه بضمير \"نحن\" أو \"نحن\" أو \"خاصتنا\") ندرك أهمية حماية خصوصية معلومات معينة (\"المعلومات\") تم جمعها عن عملائنا وعملائنا المحتملين (يشار إليهم باسم \"العملاء\" أو \"أنت\" أو \"الخاص بك\"). يكشف بيان الخصوصية هذا عن المعلومات التي نجمعها وكيفية استخدامها وكيفية تصحيحها أو تغييرها. نعتزم تزويدك بفهم حول كيفية جمعنا لمعلوماتك وكيفية استخدامها في سياق عملنا. لتحقيق هذه الغاية ، نجمع نوعين من المعلومات حول العملاء: البيانات التي يقدمها العملاء من خلال التسجيل الاختياري والطوعي على مواقعنا ؛ والبيانات التي نجمعها من خلال التتبع المجمع ، وبشكل أساسي عن طريق حساب مشاهدات الصفحة في جميع أنحاء مواقعنا. تمكننا هذه المعلومات من تصميم المحتوى الخاص بنا ليناسب احتياجات العملاء بشكل أفضل ولمساعدة معلنينا على فهم جمهورنا. يعد توفير مثل هذه البيانات المجمعة أمرًا ضروريًا للحفاظ على خدمتنا مجانية للعملاء.\r\n\r\n \r\n\r\nكيف نجمع معلومات؟\r\nتسجيل اختياري\r\nنقوم بجمع المعلومات عن طريق طلبها منك على وجه التحديد. يحدث هذا بشكل عام عند التسجيل في موقع أو طلب معلومات أو خدمة. عادةً ما تستخدم مواقعنا وشركاؤنا في الخدمة معلوماتك لتشغيل المواقع وتقديم الخدمات. تستخدم مواقعنا أيضًا معلوماتك لإبلاغك بالمنتجات أو الخدمات الأخرى المتاحة منا.\r\n\r\nتتبع الاستخدام: استخدام عناوين بروتوكول الإنترنت (\"IP\")\r\nعنوان IP هو رقم فريد يتم تعيينه تلقائيًا لجهاز الكمبيوتر الخاص بك كلما كنت تتصفح الإنترنت بحيث يمكن التعرف على جهاز الكمبيوتر الخاص بك عن طريق أجهزة الكمبيوتر الرئيسية ، المعروفة باسم \"خوادم الويب\" ، والتي \"تقدم\" صفحات الويب. نقوم بجمع عناوين IP لأغراض إدارة النظام ، لإبلاغ معلنينا بالمعلومات المجمعة ، ولتدقيق استخدام موقعنا. عندما يطلب العملاء صفحات من مواقعنا ، تقوم خوادمنا بتسجيل عناوين IP الخاصة بالعميل. لا نربط عادةً عناوين IP بأي شيء يمكن تحديده شخصيًا ، مما يعني أنه سيتم تسجيل جلسة العميل ، ولكن سيظل العميل مجهول الهوية بالنسبة لنا. يمكننا وسنستخدم عناوين IP لتحديد هوية العميل عندما نشعر أنه ضروري لفرض الامتثال لشروط استخدام موقعنا أو شروط الخدمة أو لحماية خدمتنا أو موقعنا أو عملائنا أو غيرهم.\r\n<br></span></pre></div>');
